  name: 'Dropdown',
  props: {
    direction: {
      type: String,
      default: 'down'
    },
    multiLevel: {
      type: Boolean,
      default: false
    },
    title: String,
    icon: String
  },
  data: function data() {
    return {
      isOpen: false
    };
  },
  methods: {
    toggleDropDown: function toggleDropDown() {
      if (this.multiLevel) {
        this.isOpen = true;
      } else {
        this.isOpen = !this.isOpen;
      }
    },
    closeDropDown: function closeDropDown() {
      this.isOpen = false;
